function xFB_text(ele) {
	var lng=navigator.language.split('-')[0]||navigator.userLanguage.split('-')[0];
    switch(lng) {
        case "de":
            switch(ele) {
    	        case "ter":	return "Terra";
	            case "fla":	return "Feuer";
                case "vik":	return "Vikinger";
                case "sea":	return "Meer";
                case "oly":	return "Olympus";
        	    case "nat":	return "Natur";
                case "azt":	return "Azteke";
    	        case "ele":	return "Elektro";
                case "egy":	return "Egyptisch";
	            case "ice":	return "Eis";
        	    case "met":	return "Metall";
    	        case "dar":	return "Dunkel";
                case "dem":	return "Dungeon";
	            case "lig":	return "Licht";
            	case "war":	return "Krieg";
        	    case "pur":	return "Rein";
    	        case "leg":	return "Legend&auml;r";
                case "phy":	return "Physisch";
	        }
        break;
        case "en":
            switch(ele) {
    	        case "ter":	return "Terra";
	            case "fla":	return "Flame";
                case "vik":	return "Viking";
            	case "sea":	return "Sea";
                case "oly":	return "Olympus"
        	    case "nat":	return "Nature";
                case "azt":	return "Aztec";
    	        case "ele":	return "Electric";
                case "egy":	return "Egyptian";
	            case "ice":	return "Ice";
        	    case "met":	return "Metal";
    	        case "dar":	return "Dark";
                case "dem":	return "Dungeon";
	            case "lig":	return "Light";
            	case "war":	return "War";
        	    case "pur":	return "Pure";
    	        case "leg":	return "Legendary";
                case "phy":	return "Physical";
	        }
        break;
    }
}
